import React, { Component } from "react";
import "./ComponentImport.css";
import * as XLSX from "xlsx";

export class ComponentImport extends Component {
  render() {
    const fileData = {};

    const processExcelFile = (data) => {
      var worlkBook = XLSX.read(data, { type: "binary " });
      const wsName = worlkBook.SheetNames[0];
      const ws = worlkBook.Sheets[wsName];
      const dataParse = XLSX.utils.sheet_to_json(ws, { header: 1 });
      console.log({ dataParse });
      // var AllSheetName = worlkBook.SheetNames;
      debugger;
    };

    const fileSelect = (e) => {
      const files = e.target.files;
      fileData["fileName"] = files[0].name;

      const reader = new FileReader();
      if (typeof FileList != "undefined") {
        if (reader.readAsBinaryString) {
          reader.onload = function (e) {
            processExcelFile(e.target.result);
          };
        }
      } else {
        reader.onload = function (e) {
          const data = "";
          const bytes = new Uint8Array(e.target.result);
          for (var i = 0; i < bytes.byteLength; i++) {
            data += String.fromCharCode(bytes[i]);
          }
          processExcelFile(data);
        };
      }
      console.log(files);
    };

    return (
      <>
        <div className="content">
          <input type="file" onChange={fileSelect}></input>
        </div>
      </>
    );
  }
}

export default ComponentImport;
